import React from "react";

function Header() {
  return (
    <div class="row">
      <div class="col-md-6 offset-md-3">
        <h3 class="course-heading" style={stylesCourseHeading}>
          Spotify Artist Listener Info
        </h3>
      </div>
    </div>
  );
}

export default Header;
